import React from 'react';

const stats = [
  { label: '+120% 5-Star Reviews', color: 'bg-blue-400', icon: 'â­', style: 'top-8 left-1/2 -translate-x-1/2' },
  { label: '+180% Phone Calls', color: 'bg-yellow-300', icon: 'ðŸ“ž', style: 'top-24 right-4' },
  { label: '+200% Direction Requests', color: 'bg-primary-300', icon: 'ðŸ“', style: 'bottom-16 right-8' },
  { label: '+60% Bookings', color: 'bg-green-400', icon: 'ðŸ“…', style: 'bottom-8 left-8' },
  { label: '+90% Posts Engagement', color: 'bg-primary-400', icon: 'ðŸ“', style: 'top-1/2 left-0 -translate-y-1/2' },
];

const ServiceStatsVisual = () => (
  <div className="relative flex justify-center items-center py-8">
    {/* Phone SVG illustration */}
    <svg width="260" height="480" viewBox="0 0 260 480" fill="none" xmlns="http://www.w3.org/2000/svg" className="z-10 drop-shadow-xl">
      <rect x="10" y="10" width="240" height="460" rx="40" fill="#222" />
      <rect x="30" y="60" width="200" height="320" rx="24" fill="#fff" />
      <rect x="60" y="100" width="140" height="40" rx="12" fill="#e6fffa" />
      <rect x="60" y="160" width="140" height="40" rx="12" fill="#e6fffa" />
      <rect x="60" y="220" width="140" height="40" rx="12" fill="#e6fffa" />
      <rect x="60" y="280" width="140" height="40" rx="12" fill="#e6fffa" />
      <rect x="60" y="340" width="140" height="40" rx="12" fill="#e6fffa" />
      <circle cx="130" cy="420" r="18" fill="#5fffd7" />
      <rect x="110" y="30" width="40" height="8" rx="4" fill="#444" />
    </svg>
    {/* Stat bubbles */}
    {stats.map((stat, i) => (
      <div
        key={stat.label}
        className={`absolute ${stat.style} px-4 py-2 rounded-full text-xs font-bold text-gray-900 shadow-lg flex items-center gap-1 ${stat.color}`}
        style={{ zIndex: 20 }}
      >
        <span>{stat.icon}</span> {stat.label}
      </div>
    ))}
  </div>
);

export default ServiceStatsVisual;
